	('autoCloseVisits.visitType', NULL, 'comma-separated list of the visit type(s) to automatically close', 'dd87ab73-3a38-4d9c-acfe-30970959cc1d', NULL, NULL, NULL, NULL),
	('calculation.mandatory', 'false', 'true/false whether or not the calculation module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.', '182f9c90-0e54-4855-b93b-874ed000d4c3', NULL, NULL, NULL, NULL),
