	('myfirstmodule.tablesExcluded', 'none', 'Enter the tables to be excluded from the backup comma separated (i.e.: hl7_in_archive, hl7_in_error) into field \'databasebackup.tablesExcluded\' or use \'all\' (default) to exclude all. If you don\'t want to exclude any tables, you could also leave it to the default value \'none\'.\nExplicitly entered table names overrule any eventual \'all\' or \'none\' entries in the opposite settings field.', '9fd59fd5-0eed-4ec6-83b9-af48e4eb4881', NULL, NULL, NULL, NULL),
	('myfirstmodule.tablesIncluded', 'all', 'Enter the tables to be included into the backup comma separated (i.e.: cohort, concept) into field \'databasebackup.tablesIncluded\' or use \'all\' (default) to include all.\nExplicitly entered table names overrule any eventual \'all\' or \'none\' entries in the opposite settings field.', '8cff7e9c-7994-47a8-8af0-2ad02f00a9d8', NULL, NULL, NULL, NULL),
	('newPatientForm.relationships', NULL, 'Comma separated list of the RelationshipTypes to show on the new/short patient form.  The list is defined like \'3a, 4b, 7a\'.  The number is the RelationshipTypeId and the \'a\' vs \'b\' part is which side of the relationship is filled in by the user.', '45cc788e-6c07-4075-8fff-6da4131d9419', NULL, NULL, NULL, NULL),
