	('patient.defaultPatientIdentifierValidator', 'org.openmrs.patient.impl.LuhnIdentifierValidator', 'This property sets the default patient identifier validator.  The default validator is only used in a handful of (mostly legacy) instances.  For example, it\'s used to generate the isValidCheckDigit calculated column and to append the string "(default)" to the name of the default validator on the editPatientIdentifierType form.', '010858d1-dd43-4899-9e14-2f073a40ca8d', NULL, NULL, NULL, NULL),
	('patient.headerAttributeTypes', NULL, 'A comma delimited list of PersonAttributeType names that will be shown on the patient dashboard', '0a66b4c5-d4bc-46b4-a58f-22cad00ae7df', NULL, NULL, NULL, NULL),
	('patient.identifierPrefix', NULL, 'This property is only used if patient.identifierRegex is empty.  The string here is prepended to the sql indentifier search string.  The sql becomes "... where identifier like \'<PREFIX><QUERY STRING><SUFFIX>\';".  Typically this value is either a percent sign (%) or empty.', '146c92bf-074d-4bab-b0fb-a2d889c7fdbb', NULL, NULL, NULL, NULL),
	('patient.identifierRegex', NULL, 'WARNING: Using this search property can cause a drop in mysql performance with large patient sets.  A MySQL regular expression for the patient identifier search strings.  The @SEARCH@ string is replaced at runtime with the user\'s search string.  An empty regex will cause a simply \'like\' sql search to be used. Example: ^0*@SEARCH@([A-Z]+-[0-9])?$', '9aaeb873-753b-4e4f-bff2-8dd63974fabf', NULL, NULL, NULL, NULL),
	('patient.identifierSearchPattern', NULL, 'If this is empty, the regex or suffix/prefix search is used.  Comma separated list of identifiers to check.  Allows for faster searching of multiple options rather than the slow regex. e.g. @SEARCH@,0@SEARCH@,@SEARCH-1@-@CHECKDIGIT@,0@SEARCH-1@-@CHECKDIGIT@ would turn a request for "4127" into a search for "in (\'4127\',\'04127\',\'412-7\',\'0412-7\')"', '1c85069b-0f97-4265-9a9c-70c5be285c1d', NULL, NULL, NULL, NULL),
	('patient.identifierSuffix', NULL, 'This property is only used if patient.identifierRegex is empty.  The string here is prepended to the sql indentifier search string.  The sql becomes "... where identifier like \'<PREFIX><QUERY STRING><SUFFIX>\';".  Typically this value is either a percent sign (%) or empty.', 'a667c97f-8d0f-4c26-89ec-90733957b0ce', NULL, NULL, NULL, NULL),
	('patient.listingAttributeTypes', NULL, 'A comma delimited list of PersonAttributeType names that should be displayed for patients in _lists_', '8762c28c-b621-4384-866e-9242ee7a8c30', NULL, NULL, NULL, NULL),
	('patient.nameValidationRegex', '^[a-zA-Z \\-]+$', 'Names of the patients must pass this regex. Eg : ^[a-zA-Z \\-]+$ contains only english alphabet letters, spaces, and hyphens. A value of .* or the empty string means no validation is done.', '8bc84cf7-1973-4695-af80-2ec0b69588f7', NULL, NULL, NULL, NULL),
