	('xforms.saveFormat', 'purcforms', 'The format in which the xforms will be saved. For now we support two formats: purcforms and javarosa', '7ed24141-f7e9-4f9a-97ed-b2a2f822a271', NULL, NULL, NULL, NULL),
	('xforms.searchNewPatientAfterFormSubmission', 'true', 'Set to true if you want to search for a new patient after submitting a form, else set to false if you want to go back to the same patient.', '851e4573-2ed2-46c5-bb81-6cadd9a24272', NULL, NULL, NULL, NULL),
	('xforms.setDefaultLocation', 'false', 'Set to true if you want to set the default location to that of the logged on user.', '3c147a6b-47a7-43cd-8ed9-c0d1c4a47f4d', NULL, NULL, NULL, NULL),
	('xforms.setDefaultProvider', 'false', 'Set to true if you want to set the default provider to the logged on user, if he or she has the provider role.', 'dd0e78dd-0ac0-4eb5-9c19-51d560c4dd4e', NULL, NULL, NULL, NULL),
	('xforms.showDesignSurfaceTab', 'true', 'Set to true if you want to display the Design Surface tab of the form designer.', '4ee33f23-938f-450b-8070-94f1616ca64b', NULL, NULL, NULL, NULL),
	('xforms.showJavaScriptTab', 'false', 'Set to true if you want to display the JavaScript tab of the form designer.', 'e32c208d-37a8-462f-b957-76bad104fd8b', NULL, NULL, NULL, NULL),
	('xforms.showLanguageTab', 'false', 'Set to true if you want to display the language xml tab of the form designer.', 'dc3c08b2-dee9-44aa-92ba-1bba17b4e07f', NULL, NULL, NULL, NULL),
	('xforms.showLayoutXmlTab', 'false', 'Set to true if you want to display the layout xml tab of the form designer.', '3177d903-e783-4c2a-bdb8-ab1062063cc4', NULL, NULL, NULL, NULL),
	('xforms.showModelXmlTab', 'false', 'Set to true if you want to display the model xml tab of the form designer.', '074fbffc-58c2-4f76-811a-f0c2276e614a', NULL, NULL, NULL, NULL),
	('xforms.showOfflineFormDesigner', 'false', 'Set to true if you want to show the form designer in off line mode.', '51b8099c-8c32-4ff0-ac11-f2098b2895cd', NULL, NULL, NULL, NULL),
	('xforms.showPreviewTab', 'true', 'Set to true if you want to display the Preview tab of the form designer.', 'c00202b8-07fc-4036-9e12-6a1bb7c7333f', NULL, NULL, NULL, NULL),
	('xforms.showSubmitSuccessMsg', 'false', 'Set to true if you want to display the form submitted successfully message every time a form is submitted successfully.', 'f1f24f59-5c66-491b-a134-ea9d5e4a1986', NULL, NULL, NULL, NULL),
	('xforms.showXformsSourceTab', 'false', 'Set to true if you want to display the xforms source tab of the form designer.', 'a7320d10-2d9d-4fc0-9ead-3ead62544959', NULL, NULL, NULL, NULL),
	('xforms.singleSelectAppearance', 'minimal', 'The appearance of single select input fields. Allowed values are: {full,minimal,compact}', '866c30f0-6589-48dd-ba7b-471a6da6f77f', NULL, NULL, NULL, NULL),
	('xforms.smsFieldSepChar', '=', 'The separator between questions and answers in the sms text.', 'a8a560ec-fa5e-403a-a999-570dea0bfeaf', NULL, NULL, NULL, NULL),
	('xforms.smsSendFailureReports', 'true', 'Set to true if you want sms sender to get failure reports, else set to false.', 'badb23b6-78e3-4a8d-b7c0-754571cb1f8e', NULL, NULL, NULL, NULL),
	('xforms.smsSendSuccessReports', 'true', 'Set to true if you want sms sender to get success reports, else set to false.', 'ec448d35-18e4-4d09-b263-04fa9130d95d', NULL, NULL, NULL, NULL),
	('xforms.started', 'true', 'DO NOT MODIFY. true/false whether or not the xforms module has been started.  This is used to make sure modules that were running  prior to a restart are started again', '827ea99e-e517-4e40-bc51-12259e5d0483', NULL, NULL, NULL, NULL),
	('xforms.timeDisplayFormat', 'hh:mm a', 'The display format of time used by the xforms module.', 'b444cc4e-6a5d-4daa-9362-5cb505f3d5c2', NULL, NULL, NULL, NULL),
	('xforms.timeSubmitFormat', 'HH:mm:ss', 'The format of the time passed in the xml of the xforms model. Please make sure this matches with the date format of your data entry applications, else you will get wrong times on the server.', '3ef65ba8-7a3e-4651-a8f8-76881d8a15a1', NULL, NULL, NULL, NULL),
	('xforms.undoRedoBufferSize', '-1', 'Set to the maximum number of actions you can undo or redo. The bigger the size, the more memory your browser needs. Default value is 100. Set to -1 if you do not want any limit.', '2d837b50-a379-4acd-8084-a09e9dc6f192', NULL, NULL, NULL, NULL),
	('xforms.useAutocompleteForLocations', 'false', 'Specifies that when creating a new xform the location selection element should use autocomplete,\nNote that this only applies for OpenMRS Versions 1.8 and above', '0d0b98d9-fb1a-4f9d-812c-fb21166df0e8', NULL, NULL, NULL, NULL),
	('xforms.useAutocompleteForProviders', 'false', 'Specifies that when creating a new xform the provider selection element should use autocomplete,\nNote that this only applies for OpenMRS Versions 1.9 and above', '4620ce28-2a96-44f5-bc0e-64aec91cc777', NULL, NULL, NULL, NULL),
	('xforms.useConceptIdAsHint', 'false', 'Set to true if you want to display the concept Id as the default field description.', 'f30cf3c3-9337-4870-8f9a-3d5dbb6cd956', NULL, NULL, NULL, NULL),
	('xforms.useEncounterXform', 'true', 'Set to true if you want to use XForms to edit encounters instead of the default openmrs edit encounter screen, else set to false.', 'cae4d1c1-cc44-45e7-8308-97faa95a9d3e', NULL, NULL, NULL, NULL),
	('xforms.usePatientXform', 'false', 'Set to true if you want to use XForms to create new patients instead of the default openmrs create patient form, else set to false.', '771ec2c1-0bec-4099-86fb-c245d93b1874', NULL, NULL, NULL, NULL),
	('xforms.userSerializer', 'org.openmrs.module.xforms.serialization.DefaultUserSerializer', 'The user set serializer', '82715778-10a5-4fe8-bfe7-4eadeae9f4c8', NULL, NULL, NULL, NULL),
	('xforms.useStoredXform', 'true', 'Set to true if you want to use XForms uploaded into the database, else set to false if you want to always build an XForm on the fly from the current form definition.', '84baabe4-b312-47d6-94bd-cbf5ffa5a6fc', NULL, NULL, NULL, NULL),
