            MAX(IF(cn.concept_name = 'DIAB_CALC', cn.Value, NULL)) AS 'DIAB_CALC',
            MAX(IF(cn.concept_name = 'SMOKER_TL', cn.Value, NULL)) AS 'SMOKER_TL',
            MAX(IF(cn.concept_name = 'AR_RECOM', cn.Value, NULL)) AS 'AR_RECOM',
            MAX(IF(cn.concept_name = 'NV_AR', cn.Value, NULL)) AS 'NV_AR',
            MAX(IF(cn.concept_name = 'NV_AR_TL', cn.Value, NULL)) AS 'NV_AR_TL',
            MAX(IF(cn.concept_name = 'PH_CVD_CALC', cn.Value, NULL)) AS 'PH_CVD_CALC',
            MAX(IF(cn.concept_name = 'HIGH_RISK_CALC', cn.Value, NULL)) AS 'HIGH_RISK_CALC',
            MAX(IF(cn.concept_name = 'NV_DIAB', cn.Value, NULL)) AS 'NV_DIAB',
            MAX(IF(cn.concept_name = 'NV_DIAB_TL', cn.Value, NULL)) AS 'NV_DIAB_TL',
            MAX(IF(cn.concept_name = 'REF_DOC_TL', cn.Value, NULL)) AS 'REF_DOC_TL',
            MAX(IF(cn.concept_name = 'TARGET_SBP', cn.Value, NULL)) AS 'TARGET_SBP',
			 MAX(IF(cn.concept_name = 'TARGET_SBP_TL', cn.Value, NULL)) AS 'TARGET_SBP_TL',
            MAX(IF(cn.concept_name = 'TARGET_DBP', cn.Value, NULL)) AS 'TARGET_DBP',
			MAX(IF(cn.concept_name = 'TARGET_DBP_TL', cn.Value, NULL)) AS 'TARGET_DBP_TL'
    from
        (Select 
        cnn.concept_id,
            cnn.name as concept_name,
            o.encounter_id as enc_id,
            ifnull(o.value_text, 'NA') Value
    from
        openmrs.concept_name cnn
    join openmrs.obs o ON cnn.concept_id = o.concept_id
    where
        cnn.locale = 'en' and cnn.voided = '0'
    order by cnn.concept_id) cn
    group by cn.enc_id) obb
	where
    obb.ENC_ID > max_enc_id_in_ivr;

END//
